import React, { Component } from 'react'
import AddTodo from './AddTodo.js'
import './style.css'

class TodoApp extends Component {
  constructor (props) {
    super(props)
    this.state = {
      input: '',
      items: []
    }
  }

  render () {
    return (
      <div>
        <AddTodo props={this.state}/>
      </div>

    )
  }
}

export default TodoApp
